import React from 'react';
import { useNavigate } from 'react-router-dom';
import trustpilotLogo from '../assets/trustpilot.png';
import logos from '../assets/logos.png';
import './styles/Home.css';

const Home = () => {
  const navigate = useNavigate();

  const handleSignUpClick = () => {
    navigate('/sign-up');
  };

  return (
    <div className="home">
      <section className="hero">
        <div className="hero-content">
          <h1>Welcome to Our Platform</h1>
          <p>Join us to start trading cryptocurrencies securely and efficiently.</p>
          <button onClick={handleSignUpClick} className="get-started-btn">Get Started</button>
        </div>
        <div className="hero-logos">
          <img src={logos} alt="Exchanges" className="logos" />
        </div>
      </section>
      <section className="features">
        <h2>Features</h2>
        <div className="feature-list">
          <div className="feature-item">
            <h3>Real-time Data</h3>
            <p>Access real-time cryptocurrency market data.</p>
          </div>
          <div className="feature-item">
            <h3>Secure Trading</h3>
            <p>Trade securely with our advanced security features.</p>
          </div>
          <div className="feature-item">
            <h3>User-friendly Interface</h3>
            <p>Enjoy a seamless trading experience with our intuitive interface.</p>
          </div>
        </div>
      </section>
      <section className="cta">
        <h2>Join RoseXtrader Today</h2>
        <button className="cta-btn" onClick={handleSignUpClick}>Sign Up Now</button>
      </section>
    </div>
  );
};

export default Home;
